import React from 'react';
// import './StarWars.css';

const Item = props => {
   return (
       <div className = 'itemCard'>
           <h1>{props.item.name}</h1>
           <div className = 'details'>
               <div>Name: {props.item.name}</div>
               <div>Realm: {props.item.realm}</div>
               <div>Expires: {props.item.expires}</div>
               <div>Magical: {props.item.magical}</div>

           </div>
       </div>
   )
}


export default Item;
